package main

import (
  "bytes"
  "encoding/base64"
  "image"
  "image/jpeg"
)

func breugel_de_oude() image.Image {
  data, err := base64.StdEncoding.DecodeString(breugel_de_oude_)
  if err != nil {
    panic("invalid base64")
  }

  buf := bytes.NewBuffer(data)

  img, err := jpeg.Decode(buf)
  if err != nil {
    panic("invalid jpeg")
  }

  return img
}

const breugel_de_oude_ = ""
